import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function createEntry(entry) {
  return (
    <div>
      <Entry>
        img = {entry.img}
        term = {entry.term}
        {/* detail = {entry.detail} */}

      </Entry>
    </div>
  );
}

function App() {
  return (
    <div>
      <Entry />
      {emojipedia.map(createEntry)}
    </div>
  );
}

export default App;
